;var Dot = function(x, y){
  this.defaultRadius = Dot.Defaults.defaultRadius;
  this.createObject(x, y);
  return this;
}

/*
 * Default attributes for dots
*/
Dot.Defaults = {
  defaultRadius: 8,
  availableColors: [
    0xf35b41,
    0x8bb7fa,
    0x9955b5,
    0xe2df00,
    0x8ae88c
  ]
}

/*
 * Create the displayObject
 * of the dots.
*/
Dot.prototype.createObject = function(x, y){
  var element = this.element = new PIXI.Graphics();
  var x = x + 50;
  var y = y + 50;
  var color = this.generateColor();
  var widthAndHeight = this.defaultRadius*2;

  element.position.x = x;
  element.position.y = y;

  element.beginFill(color);
  element.lineStyle(1, color, 0.5);
  element.drawCircle(0, 0, this.defaultRadius);
  element.endFill();

  element.interactive = true;
  element.buttonMode = true;

  element.hitArea = new PIXI.Rectangle(-this.defaultRadius, -this.defaultRadius, widthAndHeight, widthAndHeight);

  this.setupEvents(element);
  return this.element;
}

Dot.prototype.updateHitArea = function() {
  var widthAndHeight = this.defaultRadius * 2;
  this.element.hitArea = new PIXI.Rectangle(-1*this.defaultRadius, -1*this.defaultRadius, widthAndHeight, widthAndHeight);
}

/*
 * Setup event handlers for mouseover
 * and mousedown.
*/
Dot.prototype.setupEvents = function(element){
  var _self = this;
  element.mouseover = function(data) {
    if (DotsController.isMouseDown === true) {
      DotsController.hoverDot(_self);
    }
  }

  element.mousedown = function(data) {
    DotsController.hoverDot(_self);
  }
}

/*
 * Check if a dot can connect to other
*/
Dot.prototype.canConnect = function(dot){
  var distance = 0.0;

  distance = Math.pow((dot.matrixPos.x - this.matrixPos.x), 2);
  distance = distance + Math.pow((dot.matrixPos.y - this.matrixPos.y), 2);
  distance = Math.sqrt(distance);

  return (distance <= 1.0 && dot.element.lineColor == this.element.lineColor);
}

Dot.prototype.release = function(){
  var element = this.element;

  var tweenAlpha = new TWEEN.Tween(element);
  tweenAlpha.to({ alpha: 0 }, 150);
  tweenAlpha.start();

  var tweenScale = new TWEEN.Tween(element.scale);

  tweenScale.to({ x: 0, y: 0 }, 150);
  tweenScale.onComplete(function(){
    this.clear;
    stage.removeChild(this);
  }.bind(element));
  tweenScale.start();
}

/*
 * Generate color for the dot
*/
Dot.prototype.generateColor = function(){
  var chosenColor = Dot.Defaults.availableColors[randomTo(Dot.Defaults.availableColors.length)];
  return chosenColor;
}

Dot.constructor = Dot;
;// Generate matrix of dots
DotMatrix = {
  dots: [],
  matrix: []
}

DotMatrix.Defaults = {
  numberOfLines: 10,
  elementsPerLine: 6
}

// Start the matrix, generate it
// and deploy to stage.
DotMatrix.start = function(){
  for (var x = 0; x < DotMatrix.Defaults.elementsPerLine; x++ ) {
    this.matrix[x] = [];

    for (var y = 0; y < DotMatrix.Defaults.numberOfLines; y++) {

      var dotY = y * (Dot.Defaults.defaultRadius * 5);
      var dotX = x * (Dot.Defaults.defaultRadius * 5);
      var dot = new Dot(dotX, dotY);

      // Keep record of the dots
      // and it positions
      dot.matrixPos = {
        x: x,
        y: y
      }

      this.matrix[x][y] = dot;
      stage.addChild(dot.element);
    }
  }

  return this.matrix;
}

DotMatrix.releaseDot = function(dot){
  var x = dot.matrixPos.x;
  var y = dot.matrixPos.y;

  this.matrix[x][y] = dot.element.position.clone();
  dot.release();
}

/*
 * Repopulate empty spaces on the matrix
*/
DotMatrix.repopulate = function(){
  for (var x = 0; x < this.matrix.length; x++) {
    for (var y = (this.matrix[x].length - 1); y >= 0; y--) {
      var dot = this.matrix[x][y];

      if (dot !== undefined && dot.x !== undefined) {
        for (var c = y; c >= 0; c--) {
          if (this.matrix[x][c].x === undefined) {
            var upperDot = this.matrix[x][c];
            var tween = new TWEEN.Tween(upperDot.element.position)
                                 .to(dot.clone(), 500)
                                 .easing(TWEEN.Easing.Bounce.Out);

            tween.onUpdate(upperDot.updateHitArea.bind(upperDot));
            tween.start();

            upperDot.matrixPos = { x: x, y: y };

            this.matrix[x][c] = upperDot.element.position.clone();
            this.matrix[x][y] = upperDot;
            break;
          }
        }
      }
    }
  }
}
;/*
 * DotsController controls
 * the flow of the game.
 * (or something like that)
*/
var DotsController = {
  connectedDots: [],
  userPoints: 0,
  timeLeft: 60,
  isMouseDown: false,
  pointsPool: 0
}

DotsController.start = function(){
  DotMatrix.start();
  DotsController.renderPoints();
}

/*
 * DotsController.hoverDot() is triggered
 * when the mouse are clicked and
 * receive the dot that it's over
*/
DotsController.hoverDot = function(dot) {
  if (dot.connected) { return true; };

  var length = this.connectedDots.length;

  if (length == 0 || dot.canConnect(this.connectedDots[length - 1])) {
    dot.connected = true;
    dot.animateHover();
    this.connectedDots.push(dot);
  }
}

DotsController.releaseDots = function(){
  for (i in DotsController.connectedDots) {
    var dot = DotsController.connectedDots[i];

    if (DotsController.connectedDots.length > 1) {
      DotMatrix.releaseDot(dot);
      DotsController.increasePoints(1);
    }

    dot.connected = false;
  }

  DotMatrix.repopulate();
  DotsController.connectedDots = [];
}

DotsController.increasePoints = function(number) {
  DotsController.userPoints = DotsController.userPoints + number;
  DotsController.renderPoints();
}

DotsController.decreasePoints = function(number) {
  DotsController.userPoints = DotsController.userPoints - number;
  DotsController.renderPoints();
}

DotsController.renderPoints = function() {
  if (DotsController._userPointsElement === undefined) {
    DotsController._userPointsElement = new PIXI.Text(DotsController.userPoints, { font: "16px Arial" });
    DotsController._userPointsElement.position = new PIXI.Point(10, 10);
    stage.addChild(DotsController._userPointsElement);
  } else {
    DotsController._userPointsElement.setText(DotsController.userPoints);
  }
}

DotsController.onMouseDown = function(event) {
  DotsController.isMouseDown = true;
}

DotsController.onMouseUp = function(event) {
  DotsController.isMouseDown = false;
  DotsController.releaseDots();
}

DotsController.onTouchDown = DotsController.onMouseDown;
DotsController.onTouchUp   = DotsController.onMouseUp;

$(document).on('mousedown', DotsController.onMouseDown);
$(document).on('mouseup', DotsController.onMouseUp);
$(document).on('touchdown', DotsController.onTouchDown);
$(document).on('touchup', DotsController.onTouchUp);
;// Stage setup
var stage = new PIXI.Stage(0xEEEEEE, true);
var renderer = PIXI.autoDetectRenderer(320, 568, null, false, true);

document.body.appendChild(renderer.view);

var canvas = $('canvas');

// Utils
function randomTo(number) {
  var number = Math.floor(Math.random() * number);
  return number;
}

// Generate Matrix
DotsController.start();


// Animate da loop
var animate = function(){
  renderer.render(stage);
  requestAnimFrame(animate);
  TWEEN.update();
}

requestAnimFrame(animate);
